    "reviewContent": "They had a decently large sample size, which is good, but they only know what the people involved ate when dining at those cafeterias, right?  But the ages of the people they compared are probably really messing with their results?  I'd say it's pretty much a given that mortality rates would be much higher among the senior center people in Missouri compared to the student center in India (which they are), but that's such a large variance in factors to try and be accounted for in one study.  And who knows what those old people were eating for years before this.  It's an interesting topic, but I think more study needs to be done.",
