    "reviewContent": "There were no statistics used to test whether or not the rate of mortality with meat was statistically significant from the other foods. \nIt also doesn't really make much sense to include younger people in this study, especially since it is only 3 years long. Younger people are more likely to be healthy and less likely to die in the 3 years of the study. Elderly are more likely to die, and diet may not have had an effect on how long these people lived. It would probably be better to do a survey the eating habits of people who are both older and relatively healthy. That way you would not have any confounding variables such as another sickness.",
