    "reviewContent": "It seems as though three years is not enough time to be able to study the potential long-term effects of diet on a person.  Also, it was not stated in the survey if any of the subjects i the study were checked for health before to ensure all of the subjects were healthy to begin with and did not have any illnesses that would lead to sickness or death.\n\nFurther, by testing food from a senior center, a fishing company, and student cafeterias, the researches did not get a group of people with similar backgrounds, ages or health.  They had a wide range of subjects that could have naturally had different mortality rates regardless of what their diet was.",
