    "reviewContent": "This is not an experiment.   The \"researches\" have merely selected a random sample of people and examined what they ate and observed whether they died over a period of time.   There is no science to conclude that this group is in any way typical of people at large or just a statistical anomaly that has nothing to do with what the nominal condition is relating diet to mortality.   If rigorous scientific method is to be followed there really needs to be work to establish a connection between diet and mortality in the first place.   This \"study\" seems to take a relationship between diet and mortality as a given.",
