    "reviewContent": "There are a lot of external variables that are not accounted for in this research. One important variable I would consider is the health of the participants at the beginning of the study. It was never mentioned if they were healthy. I'm also curious to know the ages of participants, as age and diet certainly correlate when it comes to mortality. My other major concern is while the food places were controlled, it was never stated what was the availability of each food at each place. It is very possible that one place only served beef which in turn would increase the numbers on that particular food choice.",
