    "reviewContent": "The assumption in this study that correlation equals causation is deeply flawed.  There are far too many other factors that have not been controlled and could just as easily contribute to an increased mortality rate.  Age, baseline health measurements, and lifestyles including whether subjects smoke, use drugs and alcohol, and exercise regularly (or don't) are just a few factors that need to be considered.  It may not be beef that is contributing to a higher mortality rate but something else entirely, the beef in the diet is just a coincidence.",
