    "reviewContent": "The study participants have a wide range of ages (seniors in one location, students in another) and the Fishing Company participants are more likely to be male than female, so the participants are not representative of the general population. The consistency of food options may reduce external variables, but it does not eliminate them. The mortality rates are making the assumption that people died because they ate X, which is not a reasonable conclusion (participants surely died as the result of many factors, and their health before the study was not taken into consideration). When the data from the locations is taken separately, beef consumption only had a slightly higher associated mortality than when the locations are combined (and  the numbers don't add up).",
