    "identifiedConclusion": false,
    "reviewContent": "This one seems to come to a similar conclusion to so many other studies and meta-studies: that beef clearly has a bad effect on health. Given the high amount of research I've done and the percentage of studies showing a strong correlation, I have few if any questions to even ask here, apart from where more studies might be found. I would like to see a review with even more diverse locations and diets, particularly the \"blue zone\" areas of the world.",
