    "reviewContent": "The authors were correct to limit their conclusions to a correlation between beef consumption and mortality rather than causation. Furthermore, the spread across multiple locations with likely very different diets seems to strengthen their conclusion. However, the report does not state how the mortalities were spread across the three locations. So, for example, if the mortalities by those who consumed beef were limited to a single location, the correlation might be coorelated to some specific beef product or dish at that location, not beef generally. ",
