    "reviewContent": "There are too many variables that make it impossible to make a conclusion that beef is highly correlated to an increase mortality rate. There are elderly people, young people, and all age groups in the study, when there should have been only one age group chosen to study. They live in different locations, which mean geographic location could also be a factor in the moratity rate. Also, the study was only for three years, which seems very short amount of time to study the effect of eating beef on mortality.",
