    "identifiedConclusion": false,
    "reviewContent": "Wow. Okay, the most obvious problem here is that while their sample size is a good number, the three groups they chose are not indicative of the overall population. One group is students, and are going to have a low mortality rate. Another group is people living in a senior care center, who will have a high mortality rate. The remaining group of crab fishers probably has a slightly higher mortality rate due to the danger of the work involved. Secondly, the study doesn't account for meals consumed outside of the cafeteria. Also, the cafeterias presumably aren't monitoring what is actually being eaten. ",
