    "reviewContent": "The conclusion that beef is highly correlated to an increase mortality rate based on this study is hard to accept due to several varying factors in the participant pool that were not isolated. The participants were pooled from various locations (Missouri, Maine, and India) across a variety of age groups (seniors, students, and adults); as such, this results in a drastic difference in lifestyle and beginning health that impacts the validity of the study. Because the authors did not isolate diet as the only variable, there can be no valid conclusion as a result of this study. ",
