    "reviewContent": "This study was very interesting.  One of the three groups studied was a senior care house.  I can't help but wonder if this includes a lot of elderly with existing health problems.  When I use the check boxes to the right of the graph, the chart doesn't make sense at all to me.  If I do two groups individually and then put those two groups together, the data doesn't seem to correlate.  There is also one blank bar on the graph I don't understand.  The chart is said to show 6 most consumed foods, but I see 9.  I find the data overall presented in a confusing fashion.  The results are interesting, but I believe the data needs to be presented a little differently to justify the results.",
