    "reviewContent": "You really can't just make such conclusion with his study.  First of all the population group selected are not being described.  It did not say if they are all the same age group or different.  The graph did not show on the mortality rate is mainly on which age group?  Also they did not take into account on how healthy these people were before the study.  They also not take into account on if they have similar activity level.  Besides it also depends on the person lifestyle and sometimes their occupation could make a differences.  It also did not say what is the cause of death of these people.  That is too rash to make conclusion like that. ",
