    "identifiedError": true,
    "identifiedConclusion": true,
    "reviewContent": "Your correlation only works when India is included in your data set. When each location is taken separately, they each have a different mortality rate to food ratio, with India having the lowest mortality rate over all, with no one eating beef there. Meanwhile, Missouri cheese eaters had a higher rate mortality rate. The data separately makes me think that there is something else going on. You also chose loaded locations. A senior center would likely have a much higher mortality rate than a college, and a restaurant's clientele would likely be middle aged and higher. You should have looked at a set of alike locations of clientele not just food choice. The mortality rate seems to correlate better to assumed age than to diet. ",
