    "reviewContent": "While the study's conclusion that beef is significantly less healthy is interesting, I cannot agree with that conclusion because several factors affecting mortality are not addressed in this study.  Age and health of participants is not discussed or correlated with cause of death.  Cause of death is not correlated with diet.  At which one of the testing centers did these people die?  One of the centers selected is a senior care home which is likely to have a higher mortality rate.",
