    "reviewContent": "Suspiciously, beef only shoots up as a cause of mortality when all three boxes are checked.  Otherwise and individually, it is fairly even with all other foods.  What accounts for this?  Also, the three places chosen as test sites seem to skew results.  An old folks care home would have a higher mortality rate in general, and a fishing company would have a higher rate of worksite accidents than the average cubicle farm.  Cafeteria's don't necessarily provide a wide range of healthy food choices, and would be more prone to incidents of food poisoning and other contaminants that would skew results.",
