    "reviewContent": "This study has multiple flaws.  It does not control for locale or cultural specific foods, portion size or special diets.  It also does control for the underlying health of the people being monitored or cause of death for those who died.  The study also discounts that many people who live in India are Hindu and thus would not eat beef.  In short, conclusions cannot be drawn from this study.",
