    "reviewContent": "I am wondering what other factors you consider when getting your facts.  For instance this is very general as far as just plotting the morality rate to the foods they ate.  Is it more saying that beef was a consistent food that was consumed that drew you to your conclusion.  Of the morality rate that occurred the majority of them had beef in their diet.  How much beef  did they consume?\n\nWhat amount of time after consuming the food did the participants pass away?  I think you can draw a conclusion that beef is the food that is most linked to mortality but I would need more facts of the study to exclusively conclude this.  It would be also nice to know what the participants passed away from. \n\n\nAlso one bar in your chart does not have a legend under it and Im not able to tell what food this corresponds to.  The chart does not make much sense since the locations do not add up to what the article references. I am not seeing how you drew your conclusion if looking at different locations.  The conclusion can only be found when you plot all the data sets together.  ",
