    "reviewContent": "There is nothing in what's stated to indicate that causes of death unrelated to food choices were controlled for.  A correlation between deaths and beef eating could have been due to, for example, people who work more dangerous jobs or who have reckless habits also being more prone to be beef eaters.  I'm also concerned that the spike for beef eating doesn't show up when I turn off all but one source of data.  If there's a spike for all three (and sometimes two) together why is there no such spike with any one source?  If I'm interpreting this correctly it would seem there is some sort of error in the data being presented:  it appears inconsistent.",
